pragma solidity ^0.8.14;

import "./Entity_Portal.sol";

contract Crop_Supply_Chain{

    //now here all the magic will happen
    //that's another doubt.
    Entity_Portal seed_producer_portal;
    Entity_Portal farmer_portal;

    constructor(address addr){
      seed_producer_portal = Entity_Portal(addr);
      farmer_portal = Entity_Portal(addr);
    }
}

contracts/Entity_Portal.sol.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

//lets assume that the IPFS is not available for the moment then what shall we do.

contract Entity_Portal{
    address[] public entities;

    //entity registration and deregistration done.
    function add_entity(address add) public{
        entities.push(add);
    }

    function remove_entity(address add) public{
        for(uint i = 0; i < entities.length; i++){
            if(entities[i] == add){
                entities[i] = entities[entities.length-1];
                entities.pop();
                return;
            }
        }
    }

    function get_contract_address() public view returns(address){
        return address(this);
    }
}

